  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<app-header></app-header>
<img src="./../../../assets/home.png" alt="Beautiful valley full of grass, trees and other greenery"
  class="object-center h-72 w-full">
<h2 class="my-10 italic text-center">"Valley View Estates: Tranquil Living in the
